Fasten your seat belts for the ten weeks ahead: a scorched earth of tantrums, rage-firings, reckless executive orders and a desperation inundation of so many pardons, the West Wing supply closet will run out of Sharpies.

@CapnRickySully @LiberalNavySeal @woodrow_for Yes. They certainly have no easy path to pull this off. It is just that with the mad King, all bets are off.  Fools errands start to look less risky. Group think, rage, passion. Not a good time for reason.

But they are gaming this out, too. Weighing risks &amp; rewards.

Not easy.
